import {
	SUBMIT_FORM,
	}from './actionCreators/actionTypes';


const defaultState = {
    email : null,
    mobile : null,
};

export default (state = defaultState, action) =>{
	switch (action.type){
		case SUBMIT_FORM:
			return {...state, [action.key] : action.value};
		default :
			return state;
	}
}
